import * as React from 'react';
import './article.scss';

type ArticleProps = any;

const Article: React.FC<ArticleProps> = ({ item }) => {
  return (
    <div className={'article-wrapper'}>
      <p>{item.title}</p>
    </div>
  );
};

export { Article };
